    }
    render() {
        return(
            <div>
                <h1>Photowall</h1>
                <div className = "form">
                    <form onSubmit = {this.handleSubmit}>
                        <input type = "text" placeholder = "Link" name = "link"></input>
                        <input type = "text" placeholder = "Description" name = "description"></input>
                        <button> Post </button>
                    </form>
                </div>
            </div>
        )
    }
    
}

